import React from 'react'
import Nav from 'react-bootstrap/Nav'
import { Link } from 'react-router-dom';
import UrlCall from './../ContextApi/UrlCall'

function Header() {
    let apiCall = UrlCall();
    //rated; popularity; favorites; recommendations; watchlist
    let makeApiCall = (menu) => {
        apiCall.getCustomCall(menu);
    }
    return (
        <Nav>
            <Nav.Item>
                <Nav.Link disabled href="/home"><b>SERIEX</b></Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1">
                    <Link onClick={makeApiCall()} to="/">Popular</Link>
                </Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1">
                    <Link to="/">Trending</Link>
                </Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1">
                    <Link to="/">Newest</Link>
                </Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1">
                    <Link to="/">Highest Rated</Link>
                </Nav.Link>
            </Nav.Item>

        </Nav >
    );
}

export default Header;
